export function add31(a: number, b: number): number {
  return a + b;
}

export function subtract31(a: number, b: number): number {
  return a - b;
}

export function multiply31(a: number, b: number): number {
  return a * b;
}

export function divide31(a: number, b: number): number {
  return a / b;
}
